postcontent:
K we all know that lowers are only supposed to be around $85 to $130 tops... But we have dipshits on here that sell their lowers to people for $250. I politely told this gentleman he was over priced he replied;

Hey f*** you. It's none of your d*mn business how much I sell my parts for, the market will dictatea fair price. Some people will pay a premium to not have to mess with a dealer. Flag away bitch, I'll just repost it and I'll post a listing with your email telling everyone what a c**t you are.

Then came back to say;

 Guess what, I sold 4 to one guy at $250 each, I made mine and then sold a few more at the lower price....guess who's wrong....lol Just off of those 4 I was able to buy 8 more, I'm making bank off these idiots!


Just a heads up to what you guys are dealing with here. Don't get conned by this guy. If you don't wanna mess with a dealer and still want to get a fair price just keep looking because they're out there.
